		menu:AnimateSequence( "ButtonUpKBMAR" )
	end
	
	self._sequenceLengths.ButtonUpKBMAR = 150
	f0_local0( self, f1_local1, controller )
	if CONDITIONS.IsArabic( self ) then
		ACTIONS.AnimateSequence( self, "AR", controller )
	end
	if CONDITIONS.IsMagmaGameMode( self ) and not CONDITIONS.IsArabic( self ) then
		ACTIONS.AnimateSequence( self, "WZ", controller )
	end
	return self
end

